import './main.css';

//Página de home con el menú para ir a las aplicaciones de isotracker

const Main = () =>{

    function openProject(name){
        fetch("http://localhost:8000/execExternal", options)
            .then(response => response.json())
            .then(json => {
                setRoles(json.roles);
                if(secureStorage.getItem('role') !== null){
                    setCurrentRole(secureStorage.getItem('role'))
                }else{
                    secureStorage.setItem('role', json.roles[0])
                    setCurrentRole(secureStorage.getItem('role'))
                }
                }
            )
            .catch(error => {
                console.log(error);
            })  
        fetch("http://localhost:8000/execExternal", )
    }
    
    return(
        <body>
        
        <div className="panel__container">
            <div className="panel__heading__container">
                <h4>
                    <text className="panel__heading__text">PROJECTS LIST</text>
                </h4>
            </div>
            <div className="elements__container">
                <div className="menu">
                    <div className="panel__content__container">
                        <div className="panel__content__button">
                            <button className="project__button" onClick={() => openProject("BIXLOZONE")}>BIXLOZONE</button>    
                        </div>
                    </div>   
                    <div className="panel__content__container">
                        <div>
                            <form action="http://localhost:8000/execExternal" method="POST" className="panel__content__link">
                                <input type="submit" name="project" value="COCAPI" className="project__button"/>
                            </form>       
                        </div>
                    </div>   
                </div>
            </div>   
        </div>
    </body>
    );
};

export default Main;
